import React from "react";


class Users extends React.Component {

         users = [{
                  id: 1,
                  Name: 'Tommas',
                  Surname: 'Bang',
                  Email: 'tombang@yandex.ru',
                  Age: 34,
                  Married: true
         },
         {
                  id: 2,
                  Name: 'Nickole',
                  Surname: 'Vee',
                  Email: 'nickkieV@yandex.ru',
                  Age: 19,
                  Married: false  
          }
         ]
    render() {
         return (
           <div>
                  {this.users.map((element) => (
                           <div>
                                    <h2>{element.Name} {element.Surname}</h2>
                                    <p>{element.Email}</p>
                           </div>
                  ))}
           </div>
           )

         }

        }


export default Users
